import ReactDOM from 'react-dom';
import React, {Component} from 'react';
import { Route, BrowserRouter as Router } from 'react-router-dom'
import Header from './header/Header'
import Home from './pages/home/Home';
import Footer from './footer/Footer';
import './index.css';

var routing = (
    <Router>
        <div>
            <Route path="/home" component={Home} />
        </div>
    </Router>
)

var poolData = {
    UserPoolId : 'us-east-1_4hEGEz3Sl', 
    ClientId : '31lcktg53cb9ut36l4ss1c6s8t' // your app client id here
};

var userPool = new AmazonCognitoIdentity.CognitoUserPool(poolData);

var userData = {
    Username : 'TeamRole/MasterKey', // your username here
    Pool : userPool
};

var attributeList = [];

var dataEmail = {
    Name : 'email',
    Value : 'dlee67@msudenver.edu' // your email here
};

var dataPhoneNumber = {
    Name : 'phone_number',
    Value : '1112223333' // your phone number here with +country code and no delimiters in front
};

var attributeEmail = 
new AmazonCognitoIdentity.CognitoUserAttribute(dataEmail);
var attributePhoneNumber = 
new AmazonCognitoIdentity.CognitoUserAttribute(dataPhoneNumber);

attributeList.push(attributeEmail);
attributeList.push(attributePhoneNumber);

class Root extends Component {
    render() {
        return (
        <div>
            <Header/>
            <div>
                {routing}
            </div>
            <Footer/>
        </div> 
        )       
    }
}

ReactDOM.render(<Root/>, document.getElementById('root'));
